import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";

function App(props) {
  return (
    <div>
      <Header />
      <Note 
      title={props.title}
      content={props.content} 
      />
      <Footer />
    </div>
  );
}

export default App;
